script: |
  super -f text -I q7655.spq | sort > q7655.out

inputs:
  - name: q7655.spq
    data: |
      SELECT ALL - - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT col2 < + col0 / + - 66 + + 19 / + col0 * - 63 + - 50;
  - name: tab0

outputs:
  - name: q7655.out
    data: |
      1
      21
      81
